const Color = props => {
    const [color, setColor] = useState("")
    const addNewColor = (event) => {
        console.log(event);
    };

    return (

        <form onSubmit={(e) => {
            addNewColor(e);
        }}>
            <input type="submit" value="Add" />

            <div>
                <input onChange={(e) => {
                    setColor(e.target.value);
                }}
                />

            </div>
        </form >
    );
};
export default Color
